import React from 'react';
import axios from 'axios';

function EliminarRiesgo({ id, onRiesgoEliminado }) {

  const handleEliminar = () => {

    const token = localStorage.getItem('token');
    console.log('token react: ' + token)
    if (!token) {
      // Si el usuario no está autenticado, redirigir a la página de inicio de sesión
      window.location.href = '/'; // Cambia la URL según tu configuración
      return;
    }

    const config = {
        headers: {
          'Accept': '*/*',
          'Content-Type': 'application/json',
          'Authorization': `Bearer ${token}`
        },
    };

    axios.delete(`/api/riesgos/${id}`,config)
      .then(response => {
        console.log(response.data.mensaje);
        onRiesgoEliminado(id);
      })
      .catch(error => {
        console.error(error);
      });
  };

  return (
    <button onClick={handleEliminar}>Eliminar Riesgo</button>
  );
}

export default EliminarRiesgo;
